import { Outlet, Form } from "react-router-dom";

const Root = () => {
  const styles = {
    Buttons: {
      width: '20%', 
      height: '100%', 
      background: 'blue',
      }
    }
  return (
    <>
    <div style={{
        width: '100%',
        height: 80,
        background: 'gray',
        flexDirection: 'row',
        display: 'flex'
    }}>
        <Form action="/" style={styles.Buttons}>
        <button style={{
          background: 'red',
          borderWidth: 0,
          width: '100%',
          height: '100%',
          fontSize: 80,
          fontFamily: 'fantasy'
        }}>Home</button>
      </Form>
      <Form action="/Hotels">
        <button>Hotels</button>
      </Form>
      <Form action="/QA">
        <button type="submit">QA</button>
      </Form>
      <Form action="/Help">
        <button type="submit">HELP</button>
      </Form>
      <Form action="/Map">
        <button type="submit">Map</button>
      </Form>
    </div>
    <Outlet/>
    </>
)
};

export default Root;
